  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:50.646884\",\n\t\"name\": \"animal-control-management-plan-parker-river-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Animal Control Management Plan for
  Parker River National Wildlife Refuge outlines the procedures for controlling wildlife
  and fish populations to keep them consistent with the optimum management of the
  refuge habitat.  Control programs must be designed to maintain environmental quality
  and to conserve and protect the nation's wildlife resources. They will be based
  on a broad systematic approach utilizing all available information. Reduction methods
  are chosen on the basis of effectiveness, cost, and minimal ecological disruption.
  \ Animals that are considered to be potential problems include: striped skunks,
  red fox, raccoon, opossums, woodchucks, beavers, muskrats, white-tailed deer, rabbits,
  rodents, gulls, swans, reptiles, and feral/domestic animals.  The objectives of
  the control plan are: (1) to contribute to the widest possible natural diversity
  of indigenous fish and wildlife; (2) to maintain healthy population levels of wildlife
  species; (3) to contribute to the attainment of national migratory bird and endangered
  species goals; (4) to maintain healthy populations of ground nesting bird species;
  (5) to ensure that conflicts between species are resolved in favor of endangered/threatened
  species; (6) to minimize wildlife damage to physical facilities; and (7) to minimize
  occurrence of high population densities of wildlife species which have the potential
  to transmit contagious diseases to humans.\",\n\t\"license_title\": \"License Not
